import React from "react";
import classes from "./Messages.module.css"
import {NavLink} from "react-router-dom";

const Dialog = (props) => {
    let path = "/messages/" + props.id;

    return (
        <div className={classes.dialog}>
            <NavLink to={path}>{props.name}</NavLink>
        </div>
    )
}

const Messages = () => {
    return (
        <div className={classes.dialogs}>
            <div className={classes.dialogs_item}>
                <Dialog name="Dimon" id="1"/>
                <Dialog name="Romu4" id="2"/>
                <Dialog name="Nazar" id="3"/>
                <Dialog name="Nastya" id="4"/>
                <Dialog name="Ira" id="5"/>
            </div>

            <div className={classes.messages}>
                <div className={classes.message}>Yo how are you?</div>
                <div className={classes.message}>How is your it-kamasutra?</div>
                <div className={classes.message}>I like it</div>
            </div>
        </div>
    )
}

export default Messages
